                            Note = "Comment About The Fault in Our Stars Novel",
                            Text = "I was unable to build any kind of connection to the characters. A lot of their actions seemed immature and childish to me. The main character is constantly saying how she wants everyone to treat her like a normal kid, but it's hard when she's constantly reminding you that she is dying, not reminding you that she has cancer and working through it, but that she is dying and that everything that is happening to her, is because she is dying..."
                        },
